import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Top from './components/Top';
import Login from './components/Login';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route exact path="/Top" component={Top} />
      </Switch>
    </BrowserRouter>
  )
}

export default App;
